import React from "react";
import { FaBars } from "react-icons/fa";
import { FiSearch } from "react-icons/fi";
import { FaAngleRight } from "react-icons/fa";
function DarkMode() {
  const dashboardData = [
    {
      img: "/images/leaf3.svg",
      title: "CREATE REVIEW",
    },
    {
      img: "/images/leaf2.svg",
      title: "EXPLORE PRODUCTS",
    },
    { img: "/images/leaf.svg", title: "JOURNAL" },
  ];

  const dashboardCard = dashboardData.map((card) => (
    <div key={card.title} className="w-full py-1 bg-[#6F7933] rounded-md">
      <div className="flex gap-4 items-center ml-5 ">
        <img src={card.img} alt="card" className="max-w-full h-auto" />
        <p className="text-3xl">{card.title}</p>
      </div>
    </div>
  ));

  return (
    <div className="grid place-items-center bg-[#191C1A]">
      {/* 
      ///////////Profile////////
      ////////////////////////// */}
      <div className="pr-2 pl-3 max-w-[30rem] w-full">
        <div className="flex justify-end mt-5 mb-2 ">
          <FaBars className="text-white text-xl w-[1.4rem]" />
        </div>
        <div className="flex items-center">
          {/* Welcome Section */}

          <div className="grid">
            <p className="font-family font-normal text-xl text-white">
              Hello Rich 👋
            </p>
            <p className="font-family text-white/70 text-xs font-normal">
              Welcome back!
            </p>
          </div>

          {/* Search & Photo Section */}

          <div className="flex grow gap-2 items-center justify-end">
            <div>
              <span className="w-6 h-6 rounded-md bg-[#6F7933] inline-block ">
                <FiSearch className="mx-auto h-full text-base text-[#E8E7D8]" />
              </span>
            </div>
            <div className="relative">
              <img
                src="/images/L.svg"
                className="w-6 h-6 absolute -left-1 bottom-0"
              />

              <img src="/images/Ellipse.svg" className="w-12 h-12" />
            </div>
          </div>
        </div>

        {/* 
                ///////////Dashboard////////
                ////////////////////////// */}

        <div className="mt-2">
          <p className="text-3xl text-[#E8E7D8]">DASHBOARD</p>
          <div className="grid gap-5">{dashboardCard}</div>
        </div>

        {/* 
      ///////////watch high'er education section////////
      ////////////////////////// */}

        <div>
          <p className="text-2xl mt-4 font-normal text-[#E8E7D8]">
            Watch High’er Education
          </p>
          <div className="w-full py-2 bg-[#6F7933] rounded-md flex flex-col justify-center pl-2 mt-3">
            <div className="flex gap-3">
              <img src="/images/doctor.svg" alt="" />
              <div>
                <p className="text-white text-sm font-normal font-family">
                  THE TRIM ROOM
                </p>
                <p className="text-white text-lg font-normal">
                  FROM LEAFY TO LOVELY
                </p>
                <p className="text-white/60 text-sm font-family font-medium">
                  420 views, 5 Minutes
                </p>
              </div>
            </div>
          </div>
        </div>

        {/* 
      ///////////recently reviewd section////////
      ////////////////////////// */}

        <div className="mt-3">
          <div className="flex justify-between items-center">
            <p className="text-[#E8E7D8] text-2xl font-normal">
              Recently Reviewed
            </p>
            <div className="flex items-center gap-3">
              <p className="text-sm text-white/70 font-family">See All</p>
              <FaAngleRight className="text-white " />
            </div>
          </div>
        </div>
        {/* Cards */}
        <div className="mt-2 mb-3">
          <div className="flex flex-col gap-5">{dashboardCard}</div>
        </div>
        {/* End */}
      </div>
    </div>
  );
}

export default DarkMode;
